INSERT INTO `tblperingatandini` VALUES (1,'Test','Test','2022-04-12 02:11:21',1),(2,'Peringatan Dini Cuaca D.I Yogyakarta','Waspada potensi hujan sedang-lebat yang dapat disertai kilat/petir dan angin kencang di wilayah Kota Yogya, Sleman, Gunungkidul, Bantul dan Kulon Progo bagian utara serta waspada potensi gelombang laut tinggi di perairan Yogyakarta.  Prakirawan – BMKG STAMET YIA Diperbarui : 12 Mei 2022, 05.30 WIB','2022-04-14 07:31:43',1),(3,'Peringatan Dini Cuaca D.I Yogyakarta','Waspada potensi hujan sedang-lebat yang dapat disertai kilat/petir dan angin kencang di wilayah Sleman, Gunungkidul bagian utara, Kota Yogyakarta dan Kulon Progo bagian utara. Serta waspada potensi gelombang laut tinggi di perairan Yogyakarta.  || Prakirawan – BMKG STAMET YIA || Diperbarui : 14 Mei 2022, 05.30 WIB','2022-04-14 07:32:02',1),(4,'PERINGATAN DINI CUACA WILAYAH DI YOGYAKARTA ','Peringatan Dini Cuaca Wilayah DI Yogyakarta tgl Sabtu, 14 Mei 2022 pkl. 14:22 WIB berpotensi terjadi hujan dengan intensitas sedang hingga lebat yang dapat disertai kilat/petir don angin kencang pada pkI 14:30 WIB di Kabupaten Sleman: Turi, dan sekitarnya.  Dan dapat meluas ke wilayah Kabupaten Kulon Progo: Girimulyo, Nanggulan, Samigaluh, Kalibawang, Kabupaten Gunungkidul: Semin, Ngawen, Gedangsari, Kabupaten Sleman: Gamping, Godean, Moyudan, Minggir, Seyegan, Mlati, Depok, Berbah, Prambanan, Kalasan, Ngemplak, Ngaglik, Sleman, Tempel, Pakem, Cangkringan, dan sekitarnya.  Kondisi ini diperkirakan masih dapat berlangsung hingga pkI 16:30 WIB  || Prakirawan BMKG - DI Yogyakarta ','2022-04-14 09:41:50',1),(5,'INFO PRAKIRAAN CUACA DAERAH ISTIMEWA YOGYAKARTA','HARI INI SELASA 17 MEI 2022.|| Peringatan Dini : Waspada potensi hujan sedang-lebat yang dapat disertai kilat/petir dan angin kencang di wilayah Sleman, dan Kulon Progo bagian utara serta waspada potensi gelombang laut tinggi di perairan Yogyakarta. || Prakirawan – BMKG STAMET YIA || Diperbarui : 17 Mei 2022, 05.30 WIB','2022-04-18 05:34:22',1),(